INSERT INTO `projects` VALUES ('07c86b0d-d800-428f-b80c-0d3c28355e05','20130224',_binary '\0',NULL,'2025-08-03 07:09:48.166614',NULL,'2025-08-03 07:09:48.166614','20130224','Xây dựng website để tìm kiếm, đăng ký và mua vé cho các sự kiện, hội thảo, workshop. Có tính năng quản lý sự kiện cho ban tổ chức.','Nền Tảng Đặt Vé Sự Kiện/Hội Thảo'),('1026a2df-a7d4-4361-9508-2e2f2d003a39','21130279',_binary '\0',NULL,'2025-08-03 07:09:47.801530',NULL,'2025-08-03 07:09:47.801530','21130279','Tạo một thị trường online cho các sản phẩm thủ công, đồ tự làm (DIY). Tập trung vào cộng đồng người bán và người mua, và các tùy chỉnh sản phẩm.','Website Đồ Handmade & DIY'),('1472acd0-631c-48bb-8996-18307df6c002','21130363',_binary '\0',NULL,'2025-08-03 07:09:47.457677',NULL,'2025-08-03 07:09:47.457677','21130363','Xây dựng hệ thống cho phép người dùng đặt đồ ăn từ các nhà hàng đối tác, bao gồm chọn món, giỏ hàng, thanh toán và theo dõi đơn hàng.','Nền Tảng Đặt Đồ Ăn Online'),('3614906c-31d7-46d3-a1c7-a7e4bd9c6d16','21130359',_binary '\0',NULL,'2025-08-03 07:09:48.354957',NULL,'2025-08-03 07:09:48.354957','21130359','Tạo cửa hàng trực tuyến chuyên về trang phục, giày dép và dụng cụ thể thao. Bao gồm bộ lọc theo môn thể thao, thương hiệu, và kích cỡ.','Website Bán Đồ Thể Thao & Dụng Cụ'),('3ef85d80-2e30-40e1-b1cc-e942989e23bc','21130320',_binary '\0',NULL,'2025-08-03 07:09:46.901753',NULL,'2025-08-03 07:09:46.901753','21130320','Xây dựng website bán hàng thời trang với các tính năng quản lý sản phẩm, giỏ hàng, thanh toán và tài khoản người dùng. Tập trung vào giao diện thân thiện, hình ảnh sản phẩm đẹp mắt.','Shop Thời Trang Online'),('52303823-bf1a-40e0-b047-a7c9532ef7dc','21130451',_binary '\0',NULL,'2025-08-03 07:09:47.102587',NULL,'2025-08-03 07:09:47.102587','21130451','Phát triển nền tảng thương mại điện tử chuyên về sách, có thể bao gồm quản lý danh mục, tìm kiếm nâng cao, đánh giá sản phẩm và đề xuất cá nhân hóa.','Cửa Hàng Sách Trực Tuyến'),('5899bcfc-a966-4117-b3b9-d00731b4b342','21130335',_binary '\0',NULL,'2025-08-03 07:09:47.991936',NULL,'2025-08-03 07:09:47.991936','21130335','Phát triển trang web cho phép người dùng xem lịch chiếu, chọn ghế, đặt và thanh toán vé phim trực tuyến.','Hệ Thống Đặt Vé Phim Online'),('96584a4a-c736-4e90-a639-d61bdc4f5ac3','21130371',_binary '\0',NULL,'2025-08-03 07:09:48.530710',NULL,'2025-08-03 07:09:48.530710','21130371','Phát triển website bán các sản phẩm mỹ phẩm, chăm sóc da/tóc. Có tính năng đánh giá sản phẩm, gợi ý theo loại da/tóc và ưu đãi.','Cửa Hàng Mỹ Phẩm & Chăm Sóc Sắc Đẹp'),('a4c8f860-fe6e-47b2-8e7c-fbbd9a578db4','22130001',_binary '\0',NULL,'2025-08-03 07:09:47.630142',NULL,'2025-08-03 07:09:47.630142','22130001','Phát triển website chuyên về cây cảnh, hạt giống và vật tư nông nghiệp. Có thể bao gồm thông tin chi tiết về từng loại cây, hướng dẫn chăm sóc.','Cửa Hàng Cây Cảnh Trực Tuyến'),('c090565e-6aba-4a26-90c2-a06e5be18e0e','21130320',_binary '\0',NULL,'2025-08-21 16:48:00.710372',NULL,'2025-08-21 16:48:00.710372','21130320','<p><span style=\"background-color: oklch(1 0 0); color: oklch(0.145 0 0);\">Xây dựng website bán hàng thời trang với các tính năng quản lý sản phẩm, giỏ hàng, thanh toán và tài khoản người dùng. Tập trung vào giao diện thân thiện, hình ảnh sản phẩm đẹp mắt.</span></p>','Shop Thời Trang Online'),('f488ec30-bc2e-42f7-9664-916d85afef92','21130601',_binary '\0',NULL,'2025-08-03 07:09:47.278417',NULL,'2025-08-03 07:09:47.278417','21130601','Tạo một trang web chuyên bán các sản phẩm điện tử, với tính năng lọc sản phẩm theo thông số kỹ thuật, so sánh sản phẩm và hỗ trợ khách hàng.','Website Bán Đồ Điện Tử');
